(129, 236, 'Module Variations', 'module-variations', '<p><strong> Enter any available suffixes at Extensions - Module Manager - Module - Module Class Suffix. </strong></p>\r\n<p>This template''s module system comes with a wide range of module styles, color variations, badges and icons. Below you can see which module styles come with color variations and with which badges and icons you can combine them.Here is a list of the available options:</p>\r\n<table class="variations">\r\n<tbody>\r\n<tr class="odd">\r\n<td class="bold">Box</td>\r\n<td>box1, box2, box3</td>\r\n</tr>\r\n<tr>\r\n<td class="bold">Bg</td>\r\n<td>bg1, bg2, bg3, bg4</td>\r\n</tr>\r\n<tr class="odd">\r\n<td class="bold">Icons</td>\r\n<td>tablet, cogs, phone.vv.. You can find the full icons of usage at <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.2.0 </a></td>\r\n</tr>\r\n<tr>\r\n<td class="bold">Other</td>\r\n<td>blank, menu</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 9, '2011-06-29 03:31:50', 758, '', '2014-10-24 05:10:03', 758, 0, '0000-00-00 00:00:00', '2011-06-29 03:31:50', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show