(130, 237, 'Positions', 'positions', '<p>This Joomla! template supports a wide variety of module positions which can be archived automatically by the system.The module positions are fully collapsible mean that if there are no modules published in particular position, this module position will disappear and the other modules with take this place. Also you can have 2-Columns layout (content, left or right)</p>\r\n<div class="pages-position"><button class="btn btn-lg" type="button" data-toggle="modal" data-target="#myModal"> Position Layout1 </button> <!-- Modal -->\r\n<div id="myModal" class="modal fade bs-example-modal-lg" tabindex="-1">\r\n<div class="modal-dialog">\r\n<div class="modal-content">\r\n<div class="modal-header"><button class="close" type="button" data-dismiss="modal">×</button>\r\n<h4 class="modal-title">Position Layout 1</h4>\r\n</div>\r\n<div class="modal-body"><img src="images/position1.jpg" alt="position1" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- Button trigger modal --> <button class="btn btn-lg" type="button" data-toggle="modal" data-target="#myModal2"> Position Layout 2 </button> <!-- Modal -->\r\n<div id="myModal2" class="modal fade bs-example-modal-lg" tabindex="-1">\r\n<div class="modal-dialog">\r\n<div class="modal-content">\r\n<div class="modal-header"><button class="close" type="button" data-dismiss="modal">×</button>\r\n<h4 class="modal-title">Position Layout 2</h4>\r\n</div>\r\n<div class="modal-body"><img src="images/position2.jpg" alt="position1" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 9, '2015-07-24 03:32:00', 758, '', '2015-09-08 14:38:44', 558, 0, '0000-00-00 00:00:00', '2015-07-24 03:32:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}